import React from 'react';

const PageContainer = (props) => {
  return (
    <div className="container">
      <div className="row align-items-center">
        <div className="col align-self-center page-container-border">
          {props.children}
        </div>
      </div>
    </div>
  )
}

export default PageContainer;
